- name: ruby_gapic
  type: GAPIC
  language: RUBY
- name: go_gapic
  type: GAPIC
  language: GO
- name: csharp_gapic
  type: GAPIC
  language: CSHARP
- name: nodejs_gapic
  type: GAPIC
  language: NODEJS
- name: gapic_config
  type: GAPIC_CONFIG
